import React, { useState } from 'react'
import axios from 'axios';
import Cookie from 'universal-cookie';
import Swal from 'sweetalert2'


const CreatAccount = () => {

    const cookie = new Cookie()
    const token = cookie.get('bearer')
  
    const[address,setaddress]=useState('');
    const[ID_number,setID_number]=useState('');
    const[type_mony,settype_mony]=useState('USD');
    const[balance,setbalance]=useState('');
    const[AccountType,setAccountType]=useState('');

    const [loading , setLoading] = useState(false)


    function MonyFrom(e){
        settype_mony(e.currentTarget.value)
      }

      async function Submit(e) { 
        let Flage=true
        e.preventDefault();
    
        setLoading(true);
        if (accountNumberFrom===''||accountNumberTo===''||amount===''||description==='' ) {
            Flage=false
        }
        else{
            Flage=true;
        }
        if(Flage){
    
    try{
      let res = await axios.post('http://127.0.0.1:8000/api/dotransaction',
      {
      address:address,
      ID_number:ID_number,
      type_mony:type_mony,
      balance:balance,
      AccountType:AccountType,
    
      },{
       headers:{
         Authorization : 'Bearer ' + token
       }
     }
      )
      .then((response)=>console.log(response));
    
    
      setLoading(false)
      await Swal.fire({
        position: 'center',
        icon: 'success',
        title: 'تم إجراء المناقلة  بنجاح',
        showConfirmButton: false,
        timer: 1500
      })
    } catch(err){
      setLoading(false)
      Swal.fire({
        icon: 'error',
        title: 'حدث خطأ ما',
        text: 'تعذر إجراء المناقلة ',
      })
      console.log(err)
    }
       
        }
        
    }



  return (
    <div className="">

    


    <form onSubmit={Submit} style={{padding:'15px'}} >
    
          <div style={{textAlign:'center',backgroundColor:'red', color:'white'}}> 
          <h3 >   فتح حساب مصرفي جديد</h3>
    
          </div>
          <div className="form-item"style={{width:'100%' ,display:'flex',alignItems:'center',justifyContent:'end'}}>
    
          <select onChange={MonyFrom} style={{width:'24%'}}>
          <option value="USD">
         USD
           </option>
         <option value='TRY'>
           TRY
           </option>
          <option value='EUR'>
          EUR
       </option>
            </select>
            <label htmlFor="exampleInputID23" style={{marginLeft:'1rem'}}>نوع المال المرسل</label>
    
    
    
         <input type="number" placeholder="الرقم الوطني للزبون   " 
         required
         value={ID_number}
         onChange={(e)=>setID_number(e.target.value)}
         />
        {/* <label htmlFor="exampleInputID23" className="form-label text-danger">نوع المال المرسل</label> */}
    
      
    
           
          </div>
    
          <div className="form-item"style={{width:'100%' ,display:'flex',alignItems:'center',justifyContent:'end'}}>
          <select onChange={''} style={{width:'24%'}}>
          <option value="USD">
         USD
           </option>
         <option value='TRY'>
           TRY
           </option>
          <option value='EUR'>
          EUR
       </option>
            </select>
            <label htmlFor="exampleInputID23" style={{marginLeft:'1rem'}}>الفرع</label>
    
    
         <input type=" number" placeholder="رقم حساب المستقبل "
           required
          value={accountNumberTo}
          onChange={(e)=>setaccountNumberTo(e.target.value)} />
        {/* <label htmlFor="exampleInputID23" className="form-label text-danger">نوع المال المرسل</label> */} 
          </div>
    
          <div className="form-item"style={{width:'100%' ,display:'flex',alignItems:'center',justifyContent:'space-between'}}>
          <input type="text" placeholder=" ملاحظات" 
          value={description}
          onChange={(e)=>setdescription(e.target.value)}
          />
          <input type="number" placeholder="القيمة"    
          required
          value={amount}
          onChange={(e)=>setamount(e.target.value)}
          /> 
    
          </div>
    
    
    
          <div style={{width:'50%' ,display:'flex',alignItems:'center',justifyContent:'start'}}>
          <button type='submit' className='login-btn' style={{'transform':'translateX(120px)'}}>إرسال</button>
    
          </div>
        </form>
    
    
    
    
    </div>
      )
}

export default CreatAccount
